message:
Nenhum candidato é perfeito. Sempre falta alguma coisa:
- para Ciro falta controle;
- para Simone falta competência;
- para Lula falta honestidade;
- e para Bolsonaro faltam três dias.

Bom dia irmandade patriota!☕️

.
✅ Anunciamos hoje que Vladimir Putin iria falar aos chefes dos serviços de inteligência dos países da CEI‼️

Bem, houve extensos discursos e aqui está o resumo da essência do que Vladimir Putin havia dito em uma reunião com os chefes da inteligência:

▪️Está em andamento o difícil processo de moldar uma ordem mundial mais justa; a (((hegemonia unipolar))) está  desmoronando;

▪️A política ditatorial do (((Ocidente))), em todas as áreas, está criando mais e mais problemas e crises;

▪️Segurança Externa e estabilidade interna são os pré-requisitos mais importantes para o desenvolvimento dos estados da CEI sob as condições atuais;

 ■ O (((Ocidente))) está trabalhando com cenários para desencadear novos conflitos na região da CEI e os riscos estão aumentando em toda a região da Ásia-Pacífico;

▪️O (((Ocidente))) está pronto para atingir qualquer país, para torná-lo o epicentro de uma crise, para provocar uma revolução de cores e um banho de sangue;

▪️Terrorists operando dentro do Afeganistão poderiam estar planejando ataques aos países vizinhos;

▪️ Os conflitos entre a Rússia e a Ucrânia e entre outros países da CEI são o resultado do colapso da URSS.

■ O último ponto que Vladimir Putin menciona é o mais importante porque este é A CAUSA de muitos dos conflitos de hoje no espaço pós-soviético. 👊

■ É por isso que Vladimir Putin uma vez chamou o colapso da União Soviética de "a maior catástrofe geopolítica do século 20".

Tendo encolhido, após o desmembramento da União Soviética, a civilização russa está começando a se expandir novamente. 😁💪

